import React, { useState, useEffect } from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';
import { supabase } from '../../supabaseClient';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

// Utility functions
const calculateIndoorReduction = (value) => {
  return value * 0.7; // 30% reduction for indoor air quality
};

const calculateEcologicaReduction = (value) => {
  return value * 0.6; // 40% reduction
};

const calculateCombinedReduction = (value) => {
  return value * 0.5; // 50% reduction
};

const calculateAnxietyRisk = (baseLevel, pm10, hasBlueair) => {
  let adjustedPM10 = pm10;

  // Always apply indoor reduction first
  adjustedPM10 = calculateIndoorReduction(pm10);

  // Apply Blueair reduction if enabled
  if (hasBlueair) {
    adjustedPM10 = calculateCombinedReduction(pm10);
  }

  if (!adjustedPM10) return baseLevel;
  if (adjustedPM10 >= 10) {
    const increase = adjustedPM10 / 10;
    const riskIncrease = increase * 0.12;
    return Math.min(10, baseLevel * (1 + riskIncrease));
  }
  return baseLevel;
};

const aggregateDataByDay = (data) => {
  const aggregated = {};

  data.forEach(item => {
    const date = new Date(item.date);
    const dateKey = date.toISOString().split('T')[0];

    if (!aggregated[dateKey]) {
      aggregated[dateKey] = {
        sum: 0,
        count: 0,
        date: date,
        pm10Values: []
      };
    }

    if (item['PM 10']) {
      aggregated[dateKey].pm10Values.push(item['PM 10']);
      aggregated[dateKey].count += 1;
    }
  });

  return Object.values(aggregated).map(item => ({
    date: item.date,
    'PM 10': item.count > 0 ? 
      item.pm10Values.reduce((a, b) => a + b, 0) / item.count : 
      null
  }));
};

const DatasetToggle = ({ name, isActive, onToggle, color }) => (
  <div style={{ display: 'flex', alignItems: 'center', margin: '5px 0' }}>
    <button
      onClick={() => onToggle(name)}
      style={{
        width: '20px',
        height: '20px',
        borderRadius: '50%',
        border: `2px solid ${color}`,
        backgroundColor: isActive ? color : 'white',
        cursor: 'pointer',
        marginRight: '8px',
        padding: 0
      }}
    />
    <span style={{ fontSize: '0.9rem' }}>{name}</span>
  </div>
);

const AnxietyRiskChart = ({ data, userPreferences }) => {
  const [chartData, setChartData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeDatasets, setActiveDatasets] = useState({
    'Outdoor': true
  });
  const [showBlueair, setShowBlueair] = useState(userPreferences?.hasBlueair || false);

  const toggleDataset = (name) => {
    setActiveDatasets(prev => ({
      ...prev,
      [name]: !prev[name]
    }));
  };

  useEffect(() => {
    try {
      if (!data || data.length === 0) {
        setError('No data available');
        setIsLoading(false);
        return;
      }

      // Aggregate the data by day
      const aggregatedData = aggregateDataByDay(data);

      const formattedData = {
        labels: aggregatedData.map(item => new Date(item.date)),
        datasets: [
          {
            label: 'Outdoor',
            data: aggregatedData.map(item => ({
              x: new Date(item.date),
              y: item['PM 10'] ? 
                calculateAnxietyRisk(userPreferences.anxietyLevel, item['PM 10'], false) :
                null
            })),
            borderColor: 'rgb(0, 100, 0)',
            backgroundColor: 'rgba(0, 100, 0, 0.1)',
            borderWidth: 2,
            tension: 0.1
          }
        ]
      };

      if (showBlueair) {
        formattedData.datasets.push({
          label: 'With Blueair',
          data: aggregatedData.map(item => ({
            x: new Date(item.date),
            y: item['PM 10'] ? 
              calculateAnxietyRisk(userPreferences.anxietyLevel, item['PM 10'], true) :
              null
          })),
          borderColor: 'rgb(100, 149, 237)',
          backgroundColor: 'rgba(100, 149, 237, 0.1)',
          borderWidth: 2,
          tension: 0.1
        });
      }

      setChartData(formattedData);
      setError(null);
    } catch (err) {
      console.error('Error processing anxiety risk data:', err);
      setError('Failed to process data');
    } finally {
      setIsLoading(false);
    }
  }, [data, showBlueair, userPreferences.anxietyLevel]);

  if (isLoading) return <div>Loading anxiety risk data...</div>;
  if (error) return <div>Error: {error}</div>;
  if (!chartData || !data.length) return <div>No anxiety risk data available</div>;

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      x: {
        type: 'time',
        time: {
          unit: 'day',
          displayFormats: {
            day: 'MMM d'
          }
        },
        title: {
          display: true,
          text: 'Date'
        }
      },
      y: {
        beginAtZero: true,
        max: 10,
        title: {
          display: true,
          text: 'Anxiety Risk Level'
        }
      }
    },
    plugins: {
      legend: {
        display: true,
        position: 'bottom'
      },
      tooltip: {
        mode: 'index',
        intersect: false
      }
    }
  };

  return (
    <div className="chart-container">
      <div className="chart-side">
        <div style={{ height: '400px', width: '100%' }}>
          <Line data={chartData} options={options} />
        </div>
        <div style={{ 
          marginTop: '20px',
          display: 'flex',
          gap: '20px',
          justifyContent: 'center'
        }}>
          <DatasetToggle 
            name="Outdoor" 
            isActive={activeDatasets['Outdoor']} 
            onToggle={toggleDataset}
            color="rgba(0, 100, 0, 0.8)"
          />
          {userPreferences?.hasBlueair && (
            <DatasetToggle 
              name="With Blueair" 
              isActive={showBlueair} 
              onToggle={() => setShowBlueair(!showBlueair)}
              color="rgba(100, 149, 237, 0.8)"
            />
          )}
        </div>
      </div>
    </div>
  );
};

export default AnxietyRiskChart;
